app.service('PdfMaker', [function() {

    this.createChart = function(extraDetails, salary, result) {
        function reduceToCapitalize(nameArr) {
            return nameArr.reduce(function(first, second) {
                return first[0].toUpperCase() + first.slice(1) + " " + second[0].toUpperCase() + second.slice(1)
            })
        }


        var moneyFormat = wNumb({
            mark: '.',
            thousand: ',',
            prefix: '$',
            decimals: 2
                // postfix: ' p.p.'
        });

        var pcFormat = wNumb({
            mark: '.',
            postfix: '%',
            decimals: 2
        })
        var imgData2 = 'data:image/png;base64,';
        var img1 = "data:image/jpeg;base64,";
        var columnsHeading = [
            { title: "Income Tax Calculator", dataKey: "info" },
        ];

        var columnsGraph = [
            { title: "Calculation Graph", dataKey: "info" },
        ];

        var columnsInformation = [{ title: "Calculator Information", dataKey: "info" }];


        var rowsInformation = [
            { "info": "1) The income tax calculator calculates the tax paid on gross wages. The rates are obtained from the Australian Tax Office. No allowance is made for Medicare or other levies and/or payments." },
            { "info": "2) One year is assumed to contain exactly 52 weeks. Thus according to this calculator each year has 364 days." }
        ];

        var columnsValues = [
            { title: "General Information", dataKey: "info" },
            { title: "Values", dataKey: "value" },
        ];
        var rowsValues = [
            { "info": "Full Name", "value": reduceToCapitalize((extraDetails.firstName.trim() + " " + extraDetails.lastName.trim()).split(' ')) },
            { "info": "E-Mail", "value": extraDetails.email.trim() },
            { "info": "Mobile Number", "value": "0" + extraDetails.mobile },
            { "info": "Annual Salary", "value": moneyFormat.to(salary) },
            { "info": "Payment Frequency", "value": result.paymentFrequency },
            { "info": "Net Payment Per Period", "value": moneyFormat.to(result.netPaymentPerPeriod) },
            { "info": "Tax On Income", "value": moneyFormat.to(result.taxOnIncome) },
            { "info": "Net Annual Income After Tax", "value": moneyFormat.to(result.netAnnualIncomeAfterTax) }
        ];

        //         if (extraDetails.address !== undefined && extraDetails.address.length !== 0) {
        //     rowsValues.push({ "info": "Address", "value": reduceToCapitalize(extraDetails.address.trim().replaceAll('\n', ' ').replace(/\s+/g, " ").split(" ")) });
        // }

        if (extraDetails.postalCode != undefined) {
            var postCode = extraDetails.postalCode;
            if (extraDetails.postalCode < 10) {
                postCode = "000" + extraDetails.postalCode
            }
            if (extraDetails.postalCode >= 10 && extraDetails.postalCode < 100) {
                postCode = "00" + extraDetails.postalCode
            }
            if (extraDetails.postalCode >= 100 && extraDetails.postalCode < 1000) {
                postCode = "0" + extraDetails.postalCode
            }
            rowsValues.push({ "info": "Postal Code", "value": postCode });
        }


        var options = {
            theme: 'grid'
        };

        var doc = new jsPDF('p', 'pt');
        var width1 = doc.internal.pageSize.width;
        var height1 = doc.internal.pageSize.height;

        doc.addImage(img1, 'JPEG', 0, 0, width1, height1);


        doc.autoTable(columnsHeading, [], {
            margin: { top: 20 },
            styles: {
                rowHeight: 40,
                halign: 'left',
                valign: 'middle',
                fontSize: 15
            }
        });

        doc.autoTable(columnsValues, rowsValues, {
            margin: { top: 80 },
            styles: {
                // fontSize:20,
                halign: "left",
                overflow: 'linebreak'
                    // columnWidth : 400
            },
            columnStyles: {
                info: { columnWidth: 350 },
                value: { columnWidth: 167 }
            },
        });

        var top = doc.autoTableEndPosY();

        doc.autoTable(columnsGraph, [], {
            margin: { top: top + 40 },
            styles: {
                // rowHeight:30,
                halign: 'left',
                valign: 'middle',
                // fontSize : 15
            }
        });

        top = doc.autoTableEndPosY();

        var canvas = document.createElement("canvas");

        canvg(canvas, $('#container').highcharts().getSVG());

        var img = canvas.toDataURL("image/png");


        doc.addImage(img, 'PNG', 150, top + 20);

        doc.addImage(imgData2, 'PNG', 40, 780);
        doc.setFontSize(10);
        doc.text(510, 810, 'PAGE ' + 1);




        doc.autoTable(columnsInformation, rowsInformation, {
            margin: { top: top + 290 },
            styles: {
                //   rowHeight:40,
                //   halign : 'left',
                //   valign : 'middle',
                //   fontSize : 15
                overflow: 'linebreak',
                fontSize: 10
            }
        });

        doc.save('IncomeTaxCalculator.pdf');


    }
}]);
